import React, { Component } from "react";
import FRinput from "./FRinput";

export class FRParent extends Component {
  constructor(props) {
    super(props);

    this.inputRef = React.createRef();
  }

  render() {
    return (
      <div>
        <FRinput ref/>
        <button>Click</button>
      </div>
    );
  }
}

export default FRParent;
